import React from 'react'
import {Menu, Icon} from 'antd';
const SubMenu = Menu.SubMenu;
export default class NavLeft extends React.Component{
    render(){
        return (
            <div>
                <div className="logo">
                    <img src="/assets/logo-ant.svg" alt="logo"/>
                    <h1>Imooc MS</h1>
                </div>
            </div>
        );
    }
}
